import React, { useEffect, useState } from 'react';
import '../styles/Stocks.css';

const Stocks = () => {
    const [stockData, setStockData] = useState([]);
    const [error, setError] = useState('');

    const fetchStockData = async () => {
        const API_KEY = 'U1JR5YOE3C630RJ0'; // Replace with your API key
        const symbol = 'MSFT'; // Example stock symbol
        const url = "https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&symbol=MSFT&interval=5min&apikey=U1JR5YOE3C630RJ0";

        try {
            const response = await fetch(url);
            const data = await response.json();
            const timeSeries = data['Time Series (5min)'];
            const formattedData = Object.keys(timeSeries).map(key => ({
                time: key,
                open: timeSeries[key]['1. open'],
                high: timeSeries[key]['2. high'],
                low: timeSeries[key]['3. low'],
                close: timeSeries[key]['4. close'],
            }));
            setStockData(formattedData);
        } catch (err) {
            setError('Failed to fetch stock data.');
        }
    };

    useEffect(() => {
        fetchStockData();
    }, []);

    return (
        <div className="stocks">
            <h2>Stock Prices</h2>
            {error && <p className="error">{error}</p>}
            <table>
                <thead>
                    <tr>
                        <th>Time</th>
                        <th>Open</th>
                        <th>High</th>
                        <th>Low</th>
                        <th>Close</th>
                    </tr>
                </thead>
                <tbody>
                    {stockData.map((stock, index) => (
                        <tr key={index}>
                            <td>{stock.time}</td>
                            <td>{stock.open}</td>
                            <td>{stock.high}</td>
                            <td>{stock.low}</td>
                            <td>{stock.close}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default Stocks;
